import catgirl from './Gay-Cat.png'

import './App.css';
let headpat = 0;
function App(count) {
  return (
    <div className="App">
      <header className="App-header">
        <div align="center">
          Gay Catgirl on screen for {count} seconds <br/>
          Click her to give headpats! Headpats Given {headpat}
        </div>
	      <div align="center" onClick={test} > <img src={catgirl} alt="Gay Cat"/></div>
      </header>
    </div>
  );
}
function test(){
  headpat++;
}

export default App;
